import React from "react";
import Header from "./header";
const Home = () => {
  return (
    <>
      <Header />
      <section className="members">
        <div className="row">
          <div className="col-md-3">
            <h2>1287+</h2>
            <h5>saving</h5>
          </div>
          <div className="col-md-3">
            <h2>5786+</h2>
            <h5>Photos</h5>
          </div>
          <div className="col-md-3">
            <h2>1440+</h2>
            <h5>Rockets</h5>
          </div>
          <div className="col-md-3">
            
            <h2>7110+</h2>
            <h5>Globes</h5>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
